commits.content:
*,
*::after,
*::before {
  -webkit-box-sizing: border-box;
          box-sizing: border-box;
  margin: 0;
  padding: 0;
}

html,
body {
  height: 100%;
}

html {
  font-size: 62.5%;
  scroll-behavior: smooth;
}

a {
  text-decoration: none;
}

input,
button,
textarea,
select {
  font-family: inherit;
}

button {
  border: none;
  cursor: pointer;
}

textarea {
  resize: vertical;
}

table {
  border-collapse: collapse;
  border-spacing: 0;
}

body {
  background-color: #221d1d;
  color: #fff;
}

ul {
  list-style: none;
}

.header {
  position: fixed;
  display: flexbox;
  background-image: url("../img/setup.jpg");
  height: 20vw;
  width: 100vw;
}

.icon_logo {
  width: 30px;
}
/*# sourceMappingURL=style.css.map */
